import React from "react";
import Quiz from "./Quiz";

function QuizList({quizs = []}){
  if(!QuizList.length) return <div>No Quiz Listed.</div>
  return(
    <div>
      {
        quizs.map(quiz => <Quiz key={quiz.id} {...quiz}/>)
      }
    </div>
  );
}

export default QuizList;
